
var filehtml = `

<script type="text/ng-template" id="file.html">

  <div class="task-left">
    <div class="my-main sign-nav">
         <input type="file" id="fileName" name="uploadfile" style="display:none;"/>
         <div class="fl mr50"><a href="javascript:void(0)" class="upload-btn f18 b-blue" ng-click="onupload()">上传</a></div>
         <div class="fl upload-info">
           <input type="text" name="textfield2" id="textfield2" class="upload-input c-666 fl"/>
           <a href="javascript:void(0)" class="upload-search f18">搜索</a>
         </div>
      </div>

      <div class="my-main mt15">
         <div class="my-nav overf f18 fw">
           <ul>
             <li class="my-active">全部资源</li>
             <li>我发布的</li>
           </ul>
         </div>
         <div id="allfileList" class="my-info">
            <div>
              <div ng-repeat="fileInfo in fileList" ng-click="fileclickByFileInfo(fileInfo)" class="access-list">
               <a href="javascript:void(0)">
                <div class="overf">
                  <div class="fl mr15"><img src="data:image/jpeg;base64,"/></div>
                  <div class="fl">
                    <p class="f16 mt8">{{fileInfo.fileName}}</p>
                    <p class="c-999 mt5">发布者：{{GetUserbyUid(fileInfo.uid).fullName}}<span class="ml30">来自用户上传</span></p>
                  </div>
                  <div class="fr c-999">{{TimeFromNow(fileInfo.createTime)}}</div>
                </div>
                </a>
              </div>
            </div>
            <div style="display:none;">
              <div ng-repeat="fileInfo in myfileList " ng-click="fileclickByFileInfo(fileInfo)" class="access-list">
               <a href="javascript:void(0)">
                <div class="overf">
                  <div class="fl mr15"><img src="data:image/jpeg;base64,"/></div>
                  <div class="fl">
                    <p class="f16 mt8">{{fileInfo.fileName}}</p>
                    <p class="c-999 mt5">发布者：{{GetUserbyUid(fileInfo.uid).fullName}}<span class="ml30">来自用户上传</span></p>
                  </div>
                  <div class="fr c-999">{{TimeFromNow(fileInfo.createTime)}}</div>
                </div>
                </a>
              </div>
            </div>
         </div>
       </div>
  </div>

</script>

<script type="text/ng-template" id="recentlyFile.html">
    <div ng-controller="recentlyFileController">
	<div class="left-source mr15">
	   <div class="source-nav f16 c-999">最新资源({{recentlyFiles.length}})</div>
	   <ul>
		 <li ng-repeat="fileInfo in recentlyFiles"><a href="javascript:void(0)">《{{fileInfo.fileName}}》</a></li>
	   </ul>
	</div>
	</div>
</script>

<script type="text/ng-template" id="apps.html">
    <img src="data:image/jpeg;base64,"/>
</script>

<div class="built pf access-alert">
 <div class="f18 c-333">资源</div>
 <div class="mt15">{{GetUserbyUid(fileInfoDetail.fileInfo.uid).fullName}}  上传了《{{fileInfoDetail.fileInfo.fileName}}》</div>
 <div class="overf mt15">
   <div class="fl mr15"><img src="data:image/jpeg;base64,"/></div>
   <div class="fl">
	 <p class="mt8">{{fileInfoDetail.fileInfo.fileName}}</p>
	 <p class="c-999 mt3" ng-if="fileInfoDetail.fileInfo.type == '0'">来自任务：紧急合同，需要今天签订</p>
	 <p class="c-999 mt3" ng-if="fileInfoDetail.fileInfo.type == '1'">来自用户上传</p>
   </div>
 </div>
 <div class="mt15">
   <a ng-click="download(fileInfoDetail.fileInfo)" href="javascript:void(0);" class="zy-btn mr15 b-green f20">下载</a>
   <a ng-click="share(fileInfoDetail.fileInfo)" href="javascript:void(0);" class="zy-btn mr15 b-zi f20">分享</a>
   <a ng-click="view(fileInfoDetail.fileInfo)" href="{{fileInfoDetail.fileInfo.url}}" target="_blank" class="zy-btn b-blue f20">查看</a>
 </div>
 <div class="c-999 mt20">{{fileInfoDetail.actionInfoCount}}</div>
 <div class="lately-log mt30">
   <dl ng-bind-html="fileInfoDetail.actionInfoDetail"></dl>
 </div>
</div>



`;

mainhtml += filehtml;